  def maximumUnits(self, boxTypes: list[list[int]], truckSize: int) -> int:
    ans = 0

    for boxes, units in sorted(boxTypes, key=lambda x: -x[1]):
      if boxes >= truckSize:
        return ans + truckSize * units
      ans += boxes * units
      truckSize -= boxes

