  def minimumTime(self, jobs: list[int], workers: list[int]) -> int:
    ans = 0

    jobs.sort()
    workers.sort()

    for job, worker in zip(jobs, workers):
      ans = max(ans, (job - 1) // worker + 1)

    return ans

class Solution:
  def decodeMessage(self, key: str, message: str) -> str:
